import React from "react";


const Home = () => {
    return (
        <div className="row">
       
        <div className="col-md-6 order-2 order-md-1">
            <h1 className="text-center">hello</h1>
        </div>
        <div className="col-md-6 order-1 order-md-2">
            <h1 className="text-center">world</h1>

        </div>

        </div>

        
    );
}

export default Home;
